script: |
  super -f text -I q10803.spq | sort > q10803.out

inputs:
  - name: q10803.spq
    data: |
      SELECT - col2 FROM tab2 (FORMAT parquet) WHERE NULL NOT BETWEEN - col0 / + - 94 - + - CAST ( 94 AS INTEGER ) - + ( CAST ( NULL AS INTEGER ) ) AND + - 90;
  - name: tab2

outputs:
  - name: q10803.out
    data: |
